  <td height=18 class=xl6417671 colspan=2 width=144 style='height:13.5pt;
  width:108pt'>STAGE3確認テスト</td>
  <td class=xl6417671 width=72 style='width:54pt'></td>
  <td class=xl6417671 width=72 style='width:54pt'></td>
  <td class=xl6417671 width=72 style='width:54pt'></td>
  <td class=xl6417671 width=115 style='width:86pt'></td>
  <td class=xl6417671 width=115 style='width:86pt'></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 style='height:13.5pt'></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=4 style='height:13.5pt'>リッジ回帰という手法について答えよ</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 style='height:13.5pt'></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=7 style='height:13.5pt'>ハイパーパラメータを大きな値に設定すると、すべての重みが限りなく0に近づく</td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 style='height:13.5pt'>→正解</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=5 style='height:13.5pt'>ハイパーパラメータを0に設定すると、非線形回帰となる</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=4 style='height:13.5pt'>→パラメータに寄らず、リッジ回帰は線形回帰</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=4 style='height:13.5pt'>バイアス項についても、正則化される</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=3 style='height:13.5pt'>→バイアス項には適用しない</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=5 style='height:13.5pt'>リッジ回帰の場合、隠れ層に対して正則化項を加える</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=3 style='height:13.5pt'>→出力層にも適用される</td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 style='height:13.5pt'></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
  <td class=xl6417671></td>
 </tr>
 <tr height=18 style='height:13.5pt'>
  <td height=18 class=xl6417671 colspan=6 style='height:13.5pt'>下図について、L1正則化を表しているグラフはどちらか答えよ</td>
  <td class=xl6417671></td>
 </tr>
